import * as corehttp from "@azure/core-http";
import * as lib from "../src/index";
// another node built-in that has to be shimmed for the browser
import assert from "assert";

let debug = false;
let testOnInternalServer = false;
const serverBase = "https://api.cognitive.microsoft.com";
const apiKey = process.env['INKRECOGNIZER_API_KEY'];

describe("InkRecognizerClient Creation Error test", () => {
  it("1. should throw error with missing version", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    let options = {} as lib.InkRecognizerClientOptions;
    options.applicationType = lib.ApplicationKind.Mixed;
    try {
      const client = new lib.InkRecognizerClient(serverBase, creds, options);
    }
    catch (error) {
      assert(error !== undefined)
      assert(error.message.indexOf("options.ServiceVersion") >= 0);
    }
  });

  it("2. should throw error with wrong version", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    let options = {} as lib.InkRecognizerClientOptions;
    options.version = {} as lib.ServiceVersion;
    options.applicationType = lib.ApplicationKind.Mixed;
    try {
      const client = new lib.InkRecognizerClient(serverBase, creds, options);
    }
    catch (error) {
      assert(error !== undefined)
      assert(error.message.indexOf("options.ServiceVersion") >= 0);
    }
  });
});

describe("InkRecognizerClient Creation test", () => {
  it("1. Should create InkRecognizerClient without options object", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    const client = new lib.InkRecognizerClient(serverBase, creds);
    assert(client instanceof lib.InkRecognizerClient);
  });

  it("2. Should create InkRecognizerClient with empty options object", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    let options = {} as lib.InkRecognizerClientOptions;
    try {
      const client = new lib.InkRecognizerClient(serverBase, creds, options);
      assert(client instanceof lib.InkRecognizerClient);
    }
    catch (error) {
      console.log("TEST FAIL: " + error.message + ", " + options.version.toString());
      assert(false);
    }
  });

  it("3. Should create InkRecognizerClient with options object with missing entries", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    let options = {} as lib.InkRecognizerClientOptions;
    options.language = 'en-US';
    const client = new lib.InkRecognizerClient(serverBase, creds, options);
    assert(client instanceof lib.InkRecognizerClient);
  });

  it("4. Should create InkRecognizerClient with options object with missing entries", async () => {
    const creds = new corehttp.ApiKeyCredentials({ inHeader: { "'Ocp-Apim-Subscription-Key'": apiKey } });
    let options = {} as lib.InkRecognizerClientOptions;
    options.version = lib.ServiceVersion.Preview_1_0_0;
    const client = new lib.InkRecognizerClient(serverBase, creds, options);
    assert(client instanceof lib.InkRecognizerClient);
  });
});

